import React from 'react';
import { Modal } from 'react-bootstrap';
import OwnerAssignmentData from './OwnerAssignmentData';
import ButtonComponent from './Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

function ModalDialog() {
    const [isShow,  invokeModal] = React.useState(false)
    const initModal = () => {
        return invokeModal(!false)
    }
    const handleClose = () => {
        invokeModal(false)
    }
    const handleAssignment = () => {
        invokeModal(false)
    }

    return (
        <div className='wrapper'>
            <ButtonComponent buttonClass={''} clickFunc={initModal} buttonText={'Assign Owner'}/>
            <Dialog
                open={isShow}
                onClose={handleClose}
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
            >
                <DialogTitle id="alert-dialog-title">{"Assign Owners"}</DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-description">
                        Select atleast one name to Assign Records or Remove Owners
                        <OwnerAssignmentData />
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <ButtonComponent buttonClass={''} clickFunc={handleClose} buttonText={'CANCEL'}/>
                    <ButtonComponent buttonClass={'tm-button'} clickFunc={handleAssignment} buttonText={'ASSIGN OWNERS'}/>
                </DialogActions>
             </Dialog>
            <Modal show={isShow}>


            </Modal>
        </div>
    );
}
export default ModalDialog;
